import React from 'react';
import { Link } from 'react-router-dom';
// import './UserProfile.css'; // Add your CSS for styling

const UserProfile = () => {
  // User data can be fetched from state or API
  const user = {
    name: 'John Doe',
    email: 'john.doe@example.com',
    profilePic: 'https://via.placeholder.com/150', // Replace with actual user profile picture URL
  };

  return (
    <div className="user-profile">
      <div className="profile-header">
        <img src={user.profilePic} alt="Profile" className="profile-pic" />
        <h2>{user.name}</h2>
        <p>{user.email}</p>
      </div>
      <div className="profile-actions">
        <Link to="/profile/change-password" className="action-btn">Change Password</Link>
        <Link to="/profile/change-profile-pic" className="action-btn">Change Profile Picture</Link>
      </div>
    </div>
  );
};

export default UserProfile;
